import React from "react";
import Student from "./Student";

const Grid = ({ students, onEdit, onDelete }) => {
  return (
    <>
    <div className="student-grid">
      {students.map((student) => (
        <div>
        <Student
          key={student.id}
          student={student}
          onEdit={onEdit}
          onDelete={onDelete}
        />
        <div class="wrapper">
  <div class="box">1</div>
  <div class="box">2</div>
  <div class="box">3</div>
  <div class="box">4</div>
  <div class="box">5</div>
  <div class="box">6</div>
  <div class="box">7</div>
  <div class="box">8</div>
  <div class="box">9</div>
  <div class="box">10</div>
  <div class="box">11</div>
  <div class="box">12</div>
</div>
</div>
      ))}
    </div>
    </>
  );
};

export default Grid;
